import React from "react";
import { Container, Row, Col } from "reactstrap";

const Footer = () => {
  return (
    <div className="footer-box">
      <Container>
        <Row className="footer-sub-box">
          <Col md={2}>
            <p>Sitemap</p>
            <p>Home page</p>
            <p>How it Works</p>
            <p>Blog</p>
          </Col>
          <Col md={8}>
            <p>Contact Us</p>
            <p>support@autodigg.com</p>
            <p>Copyright 2020. All rights reserved by: AutoDigg</p>
          </Col>
          <Col md={2}>hufshfksj</Col>
        </Row>
      </Container>
    </div>
  );
};

export default Footer;
